import logo from './logo.svg';
import NavbarMenu from "./components/NavbarMenu"
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <NavbarMenu/>
      </header>
    </div>
  );
}

export default App;
